  for (i = 0; i < 280; i++)
    if (alpha < -z[i])
      alpha = -z[i];
  if (alpha < 0) {
    for (i = 0; i < 280; i++)
      work.z[i] = z[i];
  } else {
    alpha += 1;
    for (i = 0; i < 280; i++)
      work.z[i] = z[i] + alpha;
  }
